import React from 'react';
import Header from './Header';
import Profile from './Profile';
import Project from './Project';
import Guestbook from './Guestbook';
import Footer from './Footer';

function App() {
  const user = {
    avatar: 'my-avatar.jpg',
    name: 'John Doe',
    bio: 'Frontend Developer'
  };
  const projects = [
    { id: 1, title: 'Project 1', image: 'project1.jpg' },
    { id: 2, title: 'Project 2', image: 'project2.jpg' }
  ];
  const messages = ['안녕하세요!', '포트폴리오 잘 봤습니다.'];

  return (
    <div>
      <Header />
      <Profile avatar={user.avatar} name={user.name} bio={user.bio} />
      <Project projects={projects} />
      <Guestbook messages={messages} onAddMessage={newMessage => console.log(newMessage)} />
      <Footer />
    </div>
  );
}

export default App;
